import React, { useState } from 'react';
import { Container,Row,Col,Button} from 'react-bootstrap';
import { useSelector } from 'react-redux';

function Cart() {
    const list = useSelector((state) => state.cart.product)
  
    return (
    <div> 
    
       
        <Container className='text-center ms-2 '><h1>CARTPAGE</h1></Container>
         {list.map( item =>
         <Container className='cartnum'>
            <Row>
                <Col>
                    <img src={item.image} className='cartimage' />
                </Col>
                <Col><span>{item.name}</span></Col>   
                <Col><span>{item.price}</span></Col>   
                <Col><Button>remove</Button></Col>   
                    
             </Row>
        
        </Container>)
       
}
   
    </div>
      );
}

export default Cart;
